const useStyles = styled((theme) => ({
    root: { flexGrow: 1 },
    menuButton: { marginRight: theme.spacing(2) },
    title: { flexGrow: 1 },
    list: { width: 250 },
    nested: { paddingLeft: theme.spacing(4) }
  }));

  const Dashboard = () => {
    const [drawerOpen, setDrawerOpen] = useState(false);
    const [anchorEl, setAnchorEl] = useState(null);

    const [leadershipTriadMenuOpen, setLeadershipTriadMenuOpen] = useState(false);

    const handleLeadershipTriadClick = () => {
      setLeadershipTriadMenuOpen(!leadershipTriadMenuOpen);
    };

    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };

    const toggleDrawer = () => {
      setDrawerOpen(!drawerOpen);
    };
    const classes = useStyles();

    const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);

    const isMenuOpen = Boolean(anchorEl);
    const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

    const handleProfileMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMobileMenuClose = () => {
        setMobileMoreAnchorEl(null);
    };

    const handleMenuClose = () => {
        setAnchorEl(null);
        handleMobileMenuClose();
    };

    const handleMobileMenuOpen = (event) => {
        setMobileMoreAnchorEl(event.currentTarget);
    };

    const menuId = 'primary-search-account-menu';
    const renderMenu = (
        <Menu
            anchorEl={anchorEl}
            anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            id={menuId}
            keepMounted
            transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            open={isMenuOpen}
            onClose={handleMenuClose}
        >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My account</MenuItem>
        </Menu>
    );

    const mobileMenuId = 'primary-search-account-menu-mobile';
    const renderMobileMenu = (
        <Menu
            anchorEl={mobileMoreAnchorEl}
            anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            id={mobileMenuId}
            keepMounted
            transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            open={isMobileMenuOpen}
            onClose={handleMobileMenuClose}
        >
            <MenuItem>
                <IconButton size="large" aria-label="show 4 new mails" color="inherit">
                    <Badge badgeContent={4} color="error">
                        <MailIcon />
                    </Badge>
                </IconButton>
                <p>Messages</p>
            </MenuItem>
            <MenuItem>
                <IconButton
                    size="large"
                    aria-label="show 17 new notifications"
                    color="inherit"
                >
                    <Badge badgeContent={17} color="error">
                        <NotificationsIcon />
                    </Badge>
                </IconButton>
                <p>Notifications</p>
            </MenuItem>
            <MenuItem onClick={handleProfileMenuOpen}>
                <IconButton
                    size="large"
                    aria-label="account of current user"
                    aria-controls="primary-search-account-menu"
                    aria-haspopup="true"
                    color="inherit"
                >
                    <Stack direction="row" spacing={2}>
                        <Avatar alt="Travis Howard" src="https://mui.com/static/images/avatar/2.jpg" />
                    </Stack>
                </IconButton>
                <p>Profile</p>
            </MenuItem>
        </Menu>
    );
    return (
      <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              edge="start"
              className={classes.menuButton}
              color="inherit"
              aria-label="menu"
              onClick={() => toggleDrawer()}
            >
              <MenuIcon />
              <Drawer
                anchor="left"
                open={drawerOpen}
                onClose={() => toggleDrawer()}
              >
                <div className={classes.list}>
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <HomeIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Home" />
                    </ListItem>
                    <ListItem button onClick={() => handleLeadershipTriadClick()}>
                      <ListItemIcon>
                        <HomeIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Leadership Triad" />
                      {leadershipTriadMenuOpen ? <ExpandLess /> : <ExpandMore />}
                    </ListItem>
                    <Collapse
                      in={leadershipTriadMenuOpen}
                      timeout="auto"
                      unmountOnExit
                    >
                      <List component="div" disablePadding>
                        <ListItem button className={classes.nested}>
                          <ListItemIcon>
                            <HomeIcon />
                          </ListItemIcon>
                        </ListItem>
                      </List>
                    </Collapse>
                    <ListItem button>
                      <ListItemIcon>
                        <InboxIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Testing" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <InboxIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Testing" />
                    </ListItem>
                  </List>
                  <Divider />
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <BusinessIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Companies" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <PeopleIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Users" />
                    </ListItem>
                  </List>
                  <Divider />
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <AccountCircleIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Profile" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <ExitToAppIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Logout" />
                    </ListItem>
                  </List>
                </div>
              </Drawer>
            </IconButton>
            <Typography variant="h6" className={classes.title}>
              Leadership Program
            </Typography>

            {/* <IconButton color="inherit" onClick={handleClick}>
              <AccountCircleIcon />
            </IconButton>
            <Menu
              id="admin-menu"
              anchorEl={anchorEl}
              keepMounted
              open={Boolean(anchorEl)}
              onClose={handleClose}
            >
              <MenuItem onClick={handleClose}>Profile</MenuItem>
              <MenuItem onClick={handleClose}>Logout</MenuItem>
            </Menu> */}
          </Toolbar>
        </AppBar>
      </div>
    );
  };

  export default Dashboard;

